import React, { Component } from "react";
import PageHelmet from "../component/common/Helmet";
import ModalVideo from 'react-modal-video';
import {FaTwitter ,FaInstagram ,FaFacebookF , FaLinkedinIn} from "react-icons/fa";
import ScrollToTop from 'react-scroll-up';
import { FiChevronUp } from "react-icons/fi";
import Header from "../component/header/Header";
import Footer from "../component/footer/Footer";
import { useHistory } from "react-router-dom";
import FooterTwo from "../component/footer/FooterTwo";

const SocialShare = [
    {Social: <FaFacebookF /> , link: 'https://www.facebook.com/'},
    {Social: <FaLinkedinIn /> , link: 'https://www.linkedin.com/'},
    {Social: <FaInstagram /> , link: 'https://www.instagram.com/'},
    {Social: <FaTwitter /> , link: 'https://twitter.com/'},
]

class PortfolioDetails extends Component{
    constructor () {
        super()
        this.state = {
          isOpen: false
        }
        this.openModal = this.openModal.bind(this)
        this.getPortfolioDetails = this.getPortfolioDetails.bind(this)

    }
    openModal () {
        this.setState({isOpen: true})
    }

    getPortfolioDetails = () => {
        const pathName  = window.location.pathname;

        if(pathName){
            const pathArray = pathName.split("/")[2];
            switch(pathArray){
                case 'sass-product':
                    return {

                    }
            }
        }
    }

    render(){
        // const portfolioDetails = this.getPortfolioDetails()
        return(
            <React.Fragment>
                <PageHelmet pageTitle='Portfolio Details' />                
                

                {/* Start Portfolio Details */}
                <div className="rn-portfolio-details ptb--120" style={{background: '#191919'}}>
                    <div className="container">
                        <div className="row">
                            <div className="col-lg-12">
                                <div className="portfolio-details">
                                    <div className="inner">
                                    <div className="single-tab-content">
                      <ul>
                        <li>
                          <a style={{fontWeight: "bold" }}>
                            Frontend Developer (React Js / Next Js){" "}
                            <span>
                              {" "}
                              - Convert figma into a nice and resposive UI
                            </span>
                          </a>
                          <div
                            style={{ display: "flex" , flexDirection : "row" }}
                          >
                            <div style={{  marginRight : 5  , width : 200 }}>
                              Tech Stack -   
                            </div>
                            <span>   React Js , Next Js , Redux , Redux thunk , React hooks , Typescript , Data Visualization , Tailwind Css , Material UI , Mapbox , React Highcharts & d3.js </span>
                          </div>
                        </li>
                        <li>
                          <a style={{fontWeight: "bold" }}>
                            Full Stack Developer
                            <span>
                              {" "}
                              - Create backend architecture , database and
                              integrating the API
                            </span>
                          </a>
                          <div
                            style={{ display: "flex" , flexDirection : "row" }}
                          >
                            <div style={{  marginRight : 5 }}>
                              Tech Stack -   
                            </div>
                            <span>   Node Js , Laravel , PHP , Twilio integration , Azure </span>
                          </div>
                        </li>
                      </ul>
                    </div>  <div className="single-tab-content">
                      <ul>
                        <li>
                          <a style={{fontWeight: "bold" }}>
                            Frontend Developer (React Js / Next Js){" "}
                            <span>
                              {" "}
                              - Convert figma into a nice and resposive UI
                            </span>
                          </a>
                          <div
                            style={{ display: "flex" , flexDirection : "row" }}
                          >
                            <div style={{  marginRight : 5  , width : 200 }}>
                              Tech Stack -   
                            </div>
                            <span>   React Js , Next Js , Redux , Redux thunk , React hooks , Typescript , Data Visualization , Tailwind Css , Material UI , Mapbox , React Highcharts & d3.js </span>
                          </div>
                        </li>
                        <li>
                          <a style={{fontWeight: "bold" }}>
                            Full Stack Developer
                            <span>
                              {" "}
                              - Create backend architecture , database and
                              integrating the API
                            </span>
                          </a>
                          <div
                            style={{ display: "flex" , flexDirection : "row" }}
                          >
                            <div style={{  marginRight : 5 }}>
                              Tech Stack -   
                            </div>
                            <span>   Node Js , Laravel , PHP , Twilio integration , Azure </span>
                          </div>
                        </li>
                      </ul>
                    </div>

                                       
                                    </div>
                                   
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                {/* End Portfolio Details */}

                <FooterTwo />  


            </React.Fragment>
        )
    }
}
export default PortfolioDetails;
